  input: 'TEXT,F3XN,,"Each quarter we send a memo to reexplain 2 programs that we
    have that in the past have been questioned:  First, Coin Program.  We have several
    credit unions in the PAC that act as collecting agents to sell the coins to its
    members.  We pay for the cost of the coins, and then the credit union forwards
    the gross sale to the PAC.  Second, we have the Cookbook Program.  This works
    the same way as the coins.  The credit unions sell books to its members, and forward
    the gross receipts to the PAC, while the PAC pays the entire cost of the books
    sold."'
